import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Modal from 'react-bootstrap/Modal';
import userIcon from '../assets/user.png';
import './Login.css';

function Login() {
  const [show, setShow] = useState(false);
  const [iniciarSesionSeleccionado, setIniciarSesionSeleccionado] = useState(true);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  const handleIniciarSesionClick = () => {
    setIniciarSesionSeleccionado(true);
  };

  const handleRegistrarseClick = () => {
    setIniciarSesionSeleccionado(false);
  };

  return (
    <>
      <button onClick={handleShow} className="icon-button">
        <img src={userIcon} alt="User" className="icon" />
        <p>Iniciar Sesi√≥n</p>
      </button>

      <Modal show={show} onHide={handleClose} size="md" centered>
        <Modal.Header closeButton>
          <Modal.Title>
            <div className="button-container">
              <button onClick={handleIniciarSesionClick} className={`iniciar-sesion ${iniciarSesionSeleccionado ? 'selected' : ''}`}>
                <p>Iniciar Sesi√≥n</p>
              </button>
              <button onClick={handleRegistrarseClick} className={`registrarse ${!iniciarSesionSeleccionado ? 'selected' : ''}`}>
                <p>Registrarse</p>
              </button>
            </div>
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            {iniciarSesionSeleccionado ? (
              // Formulario de inicio de sesi√≥n
              <>
                <Form.Group className="forms" controlId="formBasicEmail">
                  <Form.Control type="email" placeholder="Correo Electr√≥nico" autoFocus />
                </Form.Group>
                <Form.Group className="forms" controlId="formBasicPassword">
                  <Form.Control type="password" placeholder="Contrase√±a" />
                </Form.Group>
                <div className="d-flex justify-content-center">
                  <Button className="forgot" onClick={handleClose}>
                    ¬øOlvidaste tu Contrase√±a?
                  </Button>
                </div>
              </>
            ) : (
              // Formulario de registro con campos adicionales
              <>
                <Form.Group className="forms" controlId="formBasicNombre">
                  <Form.Control type="text" placeholder="Nombre" />
                </Form.Group>
                <Form.Group className="forms" controlId="formBasicApellido">
                  <Form.Control type="text" placeholder="Apellido" />
                </Form.Group>
                <Form.Group className="forms" controlId="formBasicID">
                  <Form.Control type="text" placeholder="ID o RTN" />
                </Form.Group>
                <Form.Group className="forms" controlId="formBasicEmailRegistro">
                  <Form.Control type="email" placeholder="Correo Electr√≥nico" />
                </Form.Group>
                <Form.Group className="forms" controlId="formBasicPasswordRegistro">
                  <Form.Control type="password" placeholder="Contrase√±a" />
                </Form.Group>
                <Form.Group className="forms" controlId="formBasicConfirmPassword">
                  <Form.Control type="password" placeholder="Confirmar Contrase√±a" />
                </Form.Group>
              </>
            )}
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Cerrar
          </Button>
          <Button variant="primary" onClick={handleClose}>
            {iniciarSesionSeleccionado ? 'Iniciar Sesi√≥n' : 'Registrarse'}
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default Login;
